import React, { Component } from "react";
import { Link } from "react-router-dom";

import backgroundImage from '../../paintings.json'

import styles from './Home.module.css';

class Home extends Component {

  render() {
    return (
      <div className={styles.container} styles={{ background:`url(${backgroundImage.src})` }}>
        <div className={styles.header}>Kimmi Risk's Art Gallery</div>
        <img src={backgroundImage.src} />
      </div>
    );
  }
}

export default Home;
